import React from 'react'

const Cards = ({results}) => {
    let display;

    if (results){
        display = results.map(x=>{
            let {id, name, image} = x
            return(<div key={id} className="col-4">
                <div>
                    <img src={image} alt="" className="img-fluid"/>
                    <div className='content'>
                        <div className='fs-4'>{name}</div>
                    </div>
                </div>
            </div>)
        });
    }else{
        display = "No existe" ;
    }



  return <>{display}</>
}

export default Cards
